import React from 'react';
import './Dashboard.css';

const TraineeHeader = ({ user, points, date }) => (
  <header className="trainee-header">
    <div className="brand">FitAddict</div>
    <div className="right-wrap">
      <div className="user-meta">
        <div className="hi">Hi {user?.name || ''}</div>
        <div className="date">{date}</div>
      </div>
      <div className="points-and-avatar">
        <div className="points-badge">
          <img
            src={process.env.PUBLIC_URL + '/Trophy.png'}
            alt="Trophy"
            className="trophy"
          />
          <span className="points-text">{points}pts</span>
        </div>
        <img
          src={user?.picture || '/user (1).png'}
          alt="avatar"
          className="avatar"
          onError={e => { e.target.onerror = null; e.target.src = '/user (1).png'; }}
        />
      </div>
    </div>
  </header>
);

export default TraineeHeader;
